import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ParkingLog = () => {
  const [file, setFile] = useState(null);
  const [logs, setLogs] = useState([]);
  const [message, setMessage] = useState('');

  const fetchLogs = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/parking/logs');
      setLogs(response.data);
    } catch (err) {
      console.error('Error fetching logs:', err.message);
    }
  };

  useEffect(() => {
    fetchLogs();
  }, []);

  const handleEntry = async () => {
    if (!file) {
      alert('Please upload an image');
      return;
    }

    const formData = new FormData();
    formData.append('image', file);

    try {
      const response = await axios.post('http://localhost:5000/api/parking/entry', formData);
      setMessage(`Entry Success: Slot ${response.data.slotNumber}`);
      fetchLogs();
    } catch (err) {
      setMessage('Error during entry');
    }
  };

  const handleExit = async () => {
    if (!file) {
      alert('Please upload an image');
      return;
    }

    const formData = new FormData();
    formData.append('image', file);

    try {
      const response = await axios.post('http://localhost:5000/api/parking/exit', formData);
      setMessage(`Exit Success: Fee ${response.data.fee}`);
      fetchLogs();
    } catch (err) {
      setMessage('Error during exit');
    }
  };

  return (
    <div>
      <h1>Parking Management System</h1>
      <input type="file" onChange={(e) => setFile(e.target.files[0])} />
      <button onClick={handleEntry}>Entry</button>
      <button onClick={handleExit}>Exit</button>
      {message && <p>{message}</p>}
      <table>
        <thead>
          <tr>
            <th>License Plate</th>
            <th>Entry Time</th>
            <th>Slot Number</th>
            <th>Exit Time</th>
            <th>Fee</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, index) => (
            <tr key={index}>
              <td>{log.licensePlate}</td>
              <td>{log.entryTime}</td>
              <td>{log.slotNumber}</td>
              <td>{log.exitTime}</td>
              <td>{log.fee}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ParkingLog;
